import React from "react";

const LandingPage = () => {
  return (
    <div className="bg-gradient-to-b from-white from-40% via-white to-green-200 h-screen">
      <h1 className="text-9xl font-extrabold bg-gradient-to-r from-white via-yellow-200 to-green-200 ">
        AI-Powered Streak Counter
      </h1>
    </div>
  );
};

export default LandingPage;
